"simpleText":"Venda"}},{"languageCode":"vi","languageName":{"simpleText":"Vietnamita"}},{"languageCode":"war","languageName":{"simpleText":"Waray"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"sn","languageName":{"simpleText":"Xona"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"192HgwRgOYE","title":"Curso de Git e Github [Completo] - Aprenda o Essencial em 2 horas","lengthSeconds":"9924","keywords":["Git","Github","controle de versão","repositório","commits","branches","merges","pull requests","fork","conflitos","Git Log","Git Push Origin","Git Pull","Git Ignore","área de stage","instalação Git.","curso de git","tutorial de git","curso online","curso completo","tutorial completo","tutorial para iniciantes","curso para iniciantes","curso passo a passo","tutorial passo a passo","aula de git","aula de controle de versão","aula de Github."],"channelId":"UC_issB-37g9lwfAA37fy2Tg","isOwnerViewing":false,"shortDescription":"00:00:00 - Introdução\n00:01:05 - Git na Teoria\n00:06:36 - O que é um sistema de controle de versão (VCS)\n00:13:18 - Como o git resolve o dilema dos 3 programadores\n00:19:55 - Qual a diferença entre git e github\n00:24:36 - Instalação Git\n00:31:30 - Git Init Criando Primeiro Repositório Git\n00:37:38 - Git Add e Area de Stage\n00:42:50 - Configurando Usuário e E-mail.\n00:45:59 - Git Commit\n00:50:05 - Praticando Commits\n00:56:51 - Git Log\n01:01:25 - Git Checkout\n01:12:26 - Branches e Merges na Teoria\n01:26:56 - Git Branch na prática\n01:38:18 - Git Merge\n01:42:38 - Introdução ao Github\n01:54:43 - Git push origin\n02:02:26 - Git Pull\n02:11:50 - Resolvendo Conflitos\n02:24:33 - Pull Request e Fork\n02:36:10 - Git Ignore e Finalização\n\nEste é um curso completo de Git para iniciantes que desejam aprender a controlar suas versões de código de maneira eficiente e colaborativa. O curso é dividido em seções para facilitar a aprendizagem, com um total de 15 tópicos cobertos em 2 horas e meia de conteúdo.\n\nComeçando com uma introdução, o curso abrange a teoria por trás do Git e como ele funciona como um sistema de controle de versão. Você também aprenderá como o Git resolve o dilema dos 3 programadores e qual a diferença entre Git e Github.\n\nEm seguida, o curso aborda a instalação do Git e como criar o primeiro repositório Git com o comando Git Init. Você também aprenderá sobre o Git Add e a área de stage, além de configurar o usuário e e-mail para identificação de autor.\n\nNa seção de commits, você aprenderá como usar o comando Git Commit para salvar as mudanças feitas em um repositório e praticar commits. O Git Log também será abordado para que você possa ver as alterações que foram feitas em um repositório.\n\nO curso também cobre tópicos como Git Checkout para alternar entre diferentes versões de um repositório e branches e merges na teoria e prática.\n\nOs participantes também aprenderão sobre o Github, incluindo como fazer push de commits com o comando Git Push Origin, como fazer pull de um repositório com Git Pull e como resolver conflitos ao trabalhar em equipe. O curso também aborda Pull Requests e Forks e como usar o Git Ignore para excluir arquivos do controle de versão.\n\nAo final deste curso, você terá um conhecimento completo sobre Git e como usá-lo efetivamente para gerenciar suas versões de código. Você também será capaz de colaborar com outros desenvolvedores usando o Github.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/192HgwRgOYE/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLAc8Wy5ardPKoSeD3l3N2cHfsunyA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/192HgwRgOYE/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLCJTnEpNMAEbtqt8wujtJxbTN9c3Q","width":196,"height":110},{"url":"https://i.ytimg.com/vi/192HgwRgOYE/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AO om/vi/192HgwRgOYE/maxresdefault.jpg","width":1280,"height":720}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/192HgwRgOYE","width":1280,"height":720},"title":{"simpleText":"Curso de Git e Github [Completo] - Aprenda o Essencial em 2 horas"},"description":{"simpleText":"00:00:00 - Introdução\n00:01:05 - Git na Teoria\n00:06:36 - O que é um sistema de controle de versão (VCS)\n00:13:18 - Como o git resolve o dilema dos 3 programadores\n00:19:55 - Qual a diferença entre git e github\n00:24:36 - Instalação Git\n00:31:30 - Git Init Criando Primeiro Repositório Git\n00:37:38 - Git Add e Area de Stage\n00:42:50 - Configurando Usuário e E-mail.\n00:45:59 - Git Commit\n00:50:05 - Praticando Commits\n00:56:51 - Git Log\n01:01:25 - Git Checkout\n01:12:26 - Branches e Merges na Teoria\n01:26:56 - Git Branch na prática\n01:38:18 - Git Merge\n01:42:38 - Introdução ao Github\n01:54:43 - Git push origin\n02:02:26 - Git Pull\n02:11:50 - Resolvendo Conflitos\n02:24:33 - Pull Request e Fork\n02:36:10 - Git Ignore e Finalização\n\nEste é um curso completo de Git para iniciantes que desejam aprender a controlar suas versões de código de maneira eficiente e colaborativa. O curso é dividido em seções para facilitar a aprendizagem, com um total de 15 tópicos cobertos em 2 horas e meia de conteúdo.\n\nComeçando com uma introdução, o curso abrange a teoria por trás do Git e como ele funciona como um sistema de controle de versão. Você também aprenderá como o Git resolve o dilema dos 3 programadores e qual a diferença entre Git e Github.\n\nEm seguida, o curso aborda a instalação do Git e como criar o primeiro repositório Git com o comando Git Init. Você também aprenderá sobre o Git Add e a área de stage, além de configurar o usuário e e-mail para identificação de autor.\n\nNa seção de commits, você aprenderá como usar o comando Git Commit para salvar as mudanças feitas em um repositório e praticar commits. O Git Log também será abordado para que você possa ver as alterações que foram feitas em um repositório.\n\nO curso também cobre tópicos como Git Checkout para alternar entre diferentes versões de um repositório e branches e merges na teoria e prática.\n\nOs participantes também aprenderão sobre o Github, incluindo como fazer push de commits com o comando Git Push Origin, como fazer pull de um repositório com Git Pull e como resolver conflitos ao trabalhar em equipe. O curso também aborda Pull Requests e Forks e como usar o Git Ignore para excluir arquivos do controle de versão.\n\nAo final deste curso, você terá um conhecimento completo sobre Git e como usá-lo efetivamente para gerenciar suas versões de código. Você também será capaz de colaborar com outros desenvolvedores usando o Github."},"lengthSeconds":"9924","ownerProfileUrl":"http://www.youtube.com/@GuiadoProgramador","externalChannelId":"UC_issB-37g9lwfAA37fy2Tg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK",  que desejam aprender a controlar suas versões de código de maneira eficiente e colaborativa. O curso é dividido em seções para facilitar a aprendizagem, com um total de 15 tópicos cobertos em 2 horas e meia de conteúdo.\n\nComeçando com uma introdução, o curso abrange a teoria por trás do Git e como ele funciona como um sistema de controle de versão. Você também aprenderá como o Git resolve o dilema dos 3 programadores e qual a diferença entre Git e Github.\n\nEm seguida, o curso aborda a instalação do Git e como criar o primeiro repositório Git com o comando Git Init. Você também aprenderá sobre o Git Add e a área de stage, além de configurar o usuário e e-mail para identificação de autor.\n\nNa seção de commits, você aprenderá como usar o comando Git Commit para salvar as mudanças feitas em um repositório e praticar commits. O Git Log também será abordado para que você possa ver as alterações que foram feitas em um repositório.\n\nO curso também cobre tópicos como Git Checkout para alternar entre diferentes versões de um repositório e branches e merges na teoria e prática.\n\nOs participantes também aprenderão sobre o Github, incluindo como fazer push de commits com o comando Git Push Origin, como fazer pull de um repositório com Git Pull e como resolver conflitos ao trabalhar em equipe. O curso também aborda Pull Requests e Forks e como usar o Git Ignore para excluir arquivos do controle de versão.\n\nAo final deste curso, você terá um conhecimento completo sobre Git e como usá-lo efetivamente para gerenciar suas versões de código. Você também será capaz de colaborar com outros desenvolvedores usando o Github.","commandRuns":[{"startIndex":0,"length":8,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJQEEM2rARgBIhMIzumq6tn6iwMV2VK4BB3g0Ani","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=192HgwRgOYE\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"192HgwRgOYE","continuePlayback":true,"startTimeSeconds":0,"wa y":{"accessibilityData":{"label":"Mostrar mais"}},"simpleText":"...mais"},"showLessText":{"simpleText":"Mostrar menos"},"attributedDescriptionBodyText":{"content":"00:00:00 - Introdução\n00:01:05 - Git na Teoria\n00:06:36 - O que é um sistema de controle de versão (VCS)\n00:13:18 - Como o git resolve o dilema dos 3 programadores\n00:19:55 - Qual a diferença entre git e github\n00:24:36 - Instalação Git\n00:31:30 - Git Init Criando Primeiro Repositório Git\n00:37:38 - Git Add e Area de Stage\n00:42:50 - Configurando Usuário e E-mail.\n00:45:59 - Git Commit\n00:50:05 - Praticando Commits\n00:56:51 - Git Log\n01:01:25 - Git Checkout\n01:12:26 - Branches e Merges na Teoria\n01:26:56 - Git Branch na prática\n01:38:18 - Git Merge\n01:42:38 - Introdução ao Github\n01:54:43 - Git push origin\n02:02:26 - Git Pull\n02:11:50 - Resolvendo Conflitos\n02:24:33 - Pull Request e Fork\n02:36:10 - Git Ignore e Finalização\n\nEste é um curso completo de Git para iniciantes que desejam aprender a controlar suas versões de código de maneira eficiente e colaborativa. O curso é dividido em seções para facilitar a aprendizagem, com um total de 15 tópicos cobertos em 2 horas e meia de conteúdo.\n\nComeçando com uma introdução, o curso abrange a teoria por trás do Git e como ele funciona como um sistema de controle de versão. Você também aprenderá como o Git resolve o dilema dos 3 programadores e qual a diferença entre Git e Github.\n\nEm seguida, o curso aborda a instalação do Git e como criar o primeiro repositório Git com o comando Git Init. Você também aprenderá sobre o Git Add e a área de stage, além de configurar o usuário e e-mail para identificação de autor.\n\nNa seção de commits, você aprenderá como usar o comando Git Commit para salvar as mudanças feitas em um repositório e praticar commits. O Git Log também será abordado para que você possa ver as alterações que foram feitas em um repositório.\n\nO curso também cobre tópicos como Git Checkout para alternar entre diferentes versões de um repositório e branches e merges na teoria e prática.\n\nOs participantes também aprenderão sobre o Github, incluindo como fazer push de commits com o comando Git Push Origin, como fazer pull de um repositório com Git Pull e como resolver conflitos ao trabalhar em equipe. O curso também aborda Pull Requests e Forks e como usar o Git Ignore para excluir arquivos do controle de versão.\n\nAo final deste curso, você terá um conhecimento completo sobre Git e como usá-lo efetivamente para gerenciar suas versões de código. Você também será capaz de colaborar com outros desenvolvedores usando o Github.","commandRuns":[{"startIndex":0,"length":8,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBkQ040EGAkiEwjO6arq2fqLAxXZUrgEHeDQCeI=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=192HgwRgOYE\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"192HgwRgOYE","continuePlayback":true,"startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-bg0s7nl6.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026siu=1\u0026msp=1\u0026odepv=1\u0026id=d7dd878304603981\u0026ip=201.28.203.58\u0026initcwndbps=1190000\u0026mt=1741443916\u0026oweuc="}}}}}}},{"startIndex":22,"length":8,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBkQ040EGAkiEwjO6arq2fqLAxXZUrgEHeDQCeI=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=192HgwRgOYE\u0026t=65s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"192HgwRgOYE","continuePlayback":true,"startTimeSeconds":65,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-bg0s7nl6.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=
